import React from 'react';
import Menu from './components/Menu';

export default function Sidebar() {
    return (
        <aside className="main-sidebar">
            <section className="sidebar position-relative">
                <div className="multinav" style={{ overflowY: 'auto' }}>
                    <div className="multinav-scroll" style={{ height: '100%' }}>
                        <ul className="sidebar-menu" data-widget="tree">
                            <Menu
                                title="General Menu"
                                subTitle={{ name: 'Dashboard' }}
                                menu={[
                                    {
                                        name: 'Analytics',
                                        to: '/analytics',
                                    },
                                    {
                                        name: 'Reports',
                                        to: '/reports',
                                    },
                                    {
                                        name: 'Advanced Search',
                                        to: '/advanced-search',
                                    },
                                ]}
                            />
                            <Menu
                                title="Cases"
                                subTitle={{ name: 'Create Case' }}
                                menu={[
                                    {
                                        name: 'Create Backlog Case',
                                        to: '/new-backlog-case',
                                    },
                                    {
                                        name: 'Create New Case',
                                        to: '/create-case',
                                    },
                                ]}
                            />
                            <Menu subTitle={{ name: 'Court Names/Numbers', to: '/court-names' }} />
                            <Menu subTitle={{ name: 'Case Defendants', to: '/case-defendants' }} />
                            <Menu subTitle={{ name: 'Backlog cases', to: '/backlog-case' }} />
                            <Menu subTitle={{ name: 'New Case Activities', to: '/case-activities' }} />
                            <Menu
                                subTitle={{ name: 'All Cases' }}
                                menu={[
                                    {
                                        name: 'All Cases',
                                        to: '/all-cases',
                                    },
                                    {
                                        name: 'Ongoing Cases',
                                        to: '/ongoing-cases',
                                    },
                                    {
                                        name: 'Awaiting Assignment',
                                        to: '/awaiting-assignment',
                                    },
                                ]}
                            />
                            <Menu subTitle={{ name: 'File/Case Assistance', to: '/case-assistance' }} />
                            <Menu subTitle={{ name: 'Direct Message', to: '/court-names' }} />
                            <Menu subTitle={{ name: 'Remainder List', to: '/court-names' }} />
                            <Menu subTitle={{ name: 'Mail', to: '/court-names' }} />
                            <Menu subTitle={{ name: 'Closed Cases', to: '/court-names' }} />
                        </ul>
                    </div>
                </div>
            </section>
            <div className="sidebar-footer">
                <a href="javascript:void(0)" className="link" data-bs-toggle="tooltip" title="Settings">
                    <span className="icon-Settings-2"></span>
                </a>
                <a href="mailbox.html" className="link" data-bs-toggle="tooltip" title="Email">
                    <span className="icon-Mail"></span>
                </a>
                <a href="javascript:void(0)" className="link" data-bs-toggle="tooltip" title="Logout">
                    <span className="icon-Lock-overturning">
                        <span className="path1"></span>
                        <span className="path2"></span>
                    </span>
                </a>
            </div>
        </aside>
    );
}
